script: |
  super -f text -I q658.spq | sort > q658.out

inputs:
  - name: q658.spq
    data: |
      SELECT ALL - - col0 * + - 97 * - - col1 + col2 + - - ( - - col2 ) AS col0 FROM tab0 (FORMAT parquet) WHERE + - col1 NOT BETWEEN - col2 AND NULL;
  - name: tab0

outputs:
  - name: q658.out
    data: |
      -117761
      -177199
